import React, {Component} from 'react';
import Developer from './components/developer';
import './App.css';

const customer = {
  'id':1,
  'image': 'https://placeimg.com/64/64/any',
  'name':'하늘',
  'birthday':'920927',
  'gender':'남자',
  'job':'대학원생'
}

class App extends Component {
  render() {
    return (
      <Developer
        name={customer.name}
        birthday={customer.birthday}
        gender={customer.gender}
        job={customer.job}
      />
    );
  }
}


export default App;
